use log::info;
use crate::gsc::config::system_config::{CaptchaConfig, ProxyConfig};
use crate::third::interface_identifying_captcha::IdentifyingCaptcha;

pub struct SBCode {
    url: String,
    cli: reqwest::Client,
}

impl SBCode {
    pub fn new(cfg: &CaptchaConfig) -> Self {
        SBCode {
            url: cfg.url.clone(),
            cli: reqwest::Client::new(),
        }
    }
}

static PREFIX: &str = "data:image/png;base64,";

impl IdentifyingCaptcha for SBCode {
    async fn identifying(&self, captcha: &str) -> anyhow::Result<String> {
        let mut captcha = captcha.to_string();
        if captcha.starts_with("data:image/png;base64,") {
            captcha = captcha.replace("data:image/png;base64,", "");
        }
        if captcha.starts_with(PREFIX) {
            let (_, rest) = captcha.split_at(PREFIX.len());
            captcha = rest.to_string();
        }
        // let req = self.cli.post("http://150.138.84.183:9896/ocr/b64").body(captcha).send().await?;
        let req = self.cli.post(self.url.clone()).body(captcha).send().await?;
        let code = req.text().await?;
        Ok(code)
    }
}

#[cfg(test)]
mod tests {
    use super::*;

    #[tokio::test]
    async fn test_sb_code() {
        let captcha = "data:image/png;base64,";
        let cfg = CaptchaConfig {
            url: "http://150.138.84.183:9896/ocr/b64".to_string(),
            token: "".to_string(),
            log_message: "".to_string(),
        };
        let sb = SBCode::new(&cfg);
        let code = sb.identifying(captcha).await.unwrap();
        println!("code: {}", code);
        assert_eq!(code, "n3xpa0dz");
    }
}